create database ASSED

use ASSED

create table TEACHERS (
	TeacherId varchar(10) not null,
	TeacherName nvarchar(20) not null,
	TeacherEmail varchar(30) not null,
	TeacherPassword varchar(20) not null,
	TeacherOrganize nvarchar(30),
	TeacherSpecialize nvarchar(20),

	constraint PK_Teacher primary key (TeacherId)
)

create table QUESTIONSETS (
	QuestionSetId varchar(10) not null,
	TeacherId varchar(10) not null,
	QuestionSetName nvarchar(50) not null,
	QuestionSetDay varchar(20) not null,
	QuestionSetNumberOfQuestion int not null,
	QuestionSetNumberOfStudentJoined int not null,
	QuestionSetTime int not null,

	constraint PK_QuestionSet primary key (QuestionSetId),
	constraint FK_QuestionSet foreign key (TeacherId) references TEACHERS(TeacherId)
)

create table QUESTIONS (
	QuestionId varchar(10) not null,
	QuestionSetId varchar(10) not null,
	QuestionTitle nvarchar(1000) not null,
	QuestionReferenceAnswer nvarchar(1000) not null,
	
	constraint PK_Question primary key (QuestionId),
	constraint FK_Question foreign key (QuestionSetId) references QUESTIONSETS(QuestionSetId)
)

create table STUDENTRESULTS (
	StudentResultId varchar(10) not null,
	QuestionId varchar(10) not null,
	StudentResultAnswer nvarchar(1000),
	StudentResultScores varchar(4) not null,
	StudentResultEmail nvarchar(30) not null,
	StudentResultVideoRecord nvarchar(100),
	
	constraint PK_StudentResult primary key (StudentResultId),
	constraint FK_StudentResult foreign key (QuestionId) references QUESTIONS(QuestionId)
)





